import React from 'react'

const Sidebar = () => {
    return (
        <aside>
            <h1>Tasks React</h1>
            <Button type="button" className="btn btn-primary">New task</Button>
            <div className="projects">
                <h2>Your Projects</h2>
                
            </div>
        </aside>
    )
}

export default Sidebar
